function getCityLocation(state, cityName) {
    var item;
    var location = [];
    

    cities.forEach(city => {
        var item = city.split(",");
        
        if (item[0] == state && item[1] == cityName){
            location = [ parseFloat(item[2]), parseFloat(item[3])];
        }
    });
    
  return  location; 
}

function getCitiesByState(state) {
    var cityList = [];
    var item;
    
    cities.forEach(city => {
        var item = city.split(",");
        
        if (item[0] == state)
        cityList.push(item[1]);

    });

    cityList.sort();

  return cityList || null; 
}

function populateCityList(lastCity){
    var state = $('#states').val();
    var citySelect = $('#cities');
    var cityList = getCitiesByState(state);

    citySelect.empty();
  
    cityList.forEach(city => {
        var opt =$('<option>', {
            value: city,
            text: city
          });
      
          // select last city
          if (lastCity == city){
            opt.prop('selected', true);
          }
      
          citySelect.append(opt);
      });
  }

// City is stored as second element in local storage
function getLastCity(){
    var local = JSON.parse(window.localStorage.getItem(appName));

    if (local){
      return local[1];
    } else {
      return null;
    }
   
  }
  